    return (
        <View style={styles.container}>
            <View>
                <Text>ESTAD√çSTICAS</Text>
                <Image source={{ uri: estadistica }} style={styles.estad} />
            </View>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 5,
        alignItems: 'center',
        backgroundColor: '#DEE1E6',
        marginTop: 35,
        marginLeft: 25,
        marginRight: 25,
        marginBottom: 35,
        borderRadius:10
    },
    estad: {
        width: 150,
        height: 100, // Ajusta la altura deseada para la imagen
    },
})

